import React, { useState } from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './Login.css';

export default function Login() {
	const [ email, setEmail ] = useState('');
	const [ password, setPassword ] = useState('');

	function validateForm() {
		return email.length > 0 && password.length > 0;
	}

	function handleSubmit(event) {
		event.preventDefault();
	}

	return (
		<>
			<div className="Login Login-Box">
				<h1 className="app-name">PhotoShare</h1>
				<Form onClick={handleSubmit}>
					<Form.Group controlId="formBasicEmail">
						<br />
						<Form.Control type="email" placeholder="Enter email..." className="login-input thin-border" />
						<br />
						<Form.Control type="password" placeholder="Enter password..." className="login-input thin-border" />
					</Form.Group>
					<Button className="button" variant="primary" type="submit">
						Log In
					</Button>
				</Form>
			</div>
			<div>

			</div>
		</>
	);
}
